import React from "react";

function PageNotFound() {
  return (
    <div className="text-center d-flex justity-content-center align-items-center">
      <div className="row">
        <div className="col co-md-6"></div>
        <h1>404</h1>
        <p>Uy, llegaste a un mundo desconocido. Mejor regresa al inicio.</p>
      </div>
    </div>
  );
}

export default PageNotFound;
